import styled from "styled-components"
import logo from '../../Assets/logo-v2.png'

const LogoImg= styled.img`
    height: 150px;
    width: 10px;

`

const LogoContainer = styled.div`
    display: flex;
    font-size: 16px;
`


function Logo() {
    return (
        <LogoContainer>
            <LogoImg
                src={logo}
                alt='logo'
            />
            
        </LogoContainer>
        
    )
}



export default Logo
